import React, { Component } from 'react'
import piano from '../images/piano.jpg'

export default class Hobbies extends Component {
  render() {
    return (
      <div>
        <h1>Here's my hobbies</h1>
        <img src={piano} className="App-logo" alt="piano" />
      </div>
    )
  }
}
